B.a2N=new A.H("Born and raised in Maseru, Lesotho. I am passionate about innovative and unconventional ways of teaching and interacting with students. I believe my duty as an educator is to empower my students to learn from and educate me as well.\n                                        \nI am a product of nurturing teachers and a home environment that encouraged learning in ways that stretched my mind and built an endless appetite for learning. I want to extend this to your child through tutoring and coaching.\n                                      \nI hold a BSc in Mathematical Statistics from the University of the Free State (South Africa) and an MFA in Creative Writing (with distinction) from Northern Arizona University (USA) awarded through the Fulbright program.\n                                      \nI was a straight \u2018A\u2019 student and loved school until I got to tertiary where my performance plummeted. This affected my confidence greatly and I found myself doubting my capabilities in all other areas in my life. I was ashamed of my undergraduate study record and often used it as evidence that I was in fact \u201cstupid\u201d and not capable of anything exceptional.\n                                      \nThis all changed when I took a job as a Maths teacher at a high school and started teaching and interacting with incredibly gifted students who reduced their intelligence or supposed lack thereof, to their grades. They would echo some of my negative self-talk and as hard as I tried to tell them how bright and gifted they were, they didn\u2019t receive my words of encouragement, until I recognized my (academic) wounding reflected in them. I started to work on my self.\n                                      \nThrough different modalities of healing, I shifted the dominant narratives I had about myself. I recognized the limitations I was placing on myself. The more inner work I did, the more my students were receptive of my encouragement. The more I also started believing in myself, and I began to dream again.\n                                      \nThe turn around\u2026\n                                      \nI was awarded the prestigious and highly competitive Fulbright scholarship, after applying three times and getting rejected twice. I strongly believe my determination and newly restored confidence set me apart. My journey of feeling like a failure and my life reflecting that, to believing I have something valuable to give to the world and to help transform the lives of others with similar limiting beliefs, led me to academic merit at Masters level. I showed up to my classes as a different person and interacted with my academics differently, with more confidence.\n                                      \nI have been on both sides of the spectrum, where school was a breeze and where school was a chore. I can help your child build a good or better relationship with their academics, regardless of which side of the spectrum they fall on.\n                                      \nI offer specialized tutoring for International Baccalaureate (IB), A-level Mathematics curricula and first year university students pursuing pure Maths or Mathematically-intensive courses.  My focus is on bridging knowledge gaps, reinforcing core concepts and ensuring a smooth transition from high school Maths to more advance Maths courses. I build my students' confidence, help them realize their full potential, while helping them release limiting beliefs about themselves. I also help those with Maths anxiety and test/exam anxiety overcome this or manage it better.\n                                      \nI work 100% online, so wherever you are, I can assist.\n                            \n\n                            ",null,B.r,null,null,null,null,null,null)
